import { configureStore } from "@reduxjs/toolkit";
import adminLoginSlice from "./admin/login-slice";
import authSlice from "./auth-slice";

 const store = configureStore({
    reducer: {
        auth: authSlice,
        adminLogin: adminLoginSlice
    }
 });

 export default store;
